// 网络拓扑弹框 

import React from 'react';
import { Modal, Tabs, Spin, Button } from 'antd'

import http from '../../../common/http';
import ReactEcharts from '../../../lib/echarts-for-react';
import { duration } from 'moment';
import HistoryOnlineStatus from './HistoryOnlineStatusView';

const { TabPane } = Tabs;

let timer;
var echartsWidth

class NetworkManageModalView extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            tabsLoading: false,
            data: [],
            panes: [],
            activeKey: "0",
            height: 650,
            width: 1100,
            option: {},
            paneData: [],
            visible: false,
            id:'',
            name:''
        }
    }
    componentWillReceiveProps(nextProps) {
        if (nextProps.visible != this.props.visible) {
            if (nextProps.visible != false) {
                this.getNetwork()
            } else {
                clearInterval(timer);
            }
        }
    }

    handleChange = (e) => {
        this.setState({ value: e.target.value })
    }

    getNetwork() {
        this.setState({
            tabsLoading: true
        })
        http.get('/network/get'
        ).then(
            res => {
                if (res.err == 0 && res.data.length != 0) {
                    //默认渲染第一个面板
                    this.getData(res.data[0])
                    let paneList = []
                    //获取第一层的结构，作为tab
                    for (let i = 0; i < res.data.length; i++) {
                        let pane = {}
                        pane.key = String(i)
                        pane.name = res.data[i].name
                        pane.networkName = res.data[i].networkName
                        paneList.push(pane)
                    }

                    this.setState({
                        panes: paneList,
                        data: res.data,
                        activeKey: "0",
                        tabsLoading: false
                    })

                }else {
                    this.setState({
                        tabsLoading: false
                    })
                }
            }).catch(
                err => {
                    this.setState({
                        tabsLoading: false
                    })
                })
    }

    getData = (masterData) => {
        let arrData = []
        let dataList = []
        let childNum = 0
        function mapData(data, father) {
            if (childNum > 300) return;
            if (father != undefined) {
                let child = []
                child = data.map(item => {
                    ++childNum
                    return {
                        name: item.name,
                        value: item.id,
                        type: item.device, //节点的设备类型
                        children: item.subnetwork.length != 0 ? mapData(item.subnetwork, item) : item.subnetwork // 判断当前是否还有子节点
                    }
                })
                return child
            } else {
                let obj = {}
                obj.name = data.name
                if (data.subnetwork.length > 0) {
                    arrData.push(mapData(data.subnetwork, obj))
                } else {
                    arrData.push(obj)
                }
            }


        }
        mapData(masterData);
        dataList = [{
            name: masterData.name,
            symbol: "image://data:image/png;base64,"
            ,
            symbolSize: 50,
            symbolOffset: [0, "-25%"],
            symbolKeepAspect: true,
            children: arrData[0]
        }]
        this.setState({
            paneData: dataList,
            width: Math.max(childNum * 160, 1150)
        })
        echartsWidth = Math.max(childNum * 160, 1150)
        //启动刷新
        clearInterval(timer);
        let _this = this
        this.refreshData(dataList, Math.max(childNum * 160, 1150));
        timer = setInterval(() => {
            _this.refreshData(dataList, Math.max(childNum * 160, 1150))
        }, 120000)
    }

    //离线在线刷新
    refreshData(dataList,width) {
        let previousData = JSON.stringify(this.state.paneData)
        if (localStorage.getItem('netDeviceDropWarningList') != undefined && dataList.length != 0) {
            let newMap = [dataList[0]]

            let dropList = JSON.parse(localStorage.getItem('netDeviceDropWarningList'))
            let onlineList = JSON.parse(localStorage.getItem('netDeviceOnlineList'))
            let unclearList = JSON.parse(localStorage.getItem('netDeviceUnclearList'))
            if (dataList[0].children && dataList[0].children.length != 0) {
                function recursion(data) {

                    data = data.map(sub => {

                        dropList.forEach(item => {
                            if (item.id == sub.value) {
                                if(item.delay && item.delay != null){
                                    if(sub.name.indexOf('最近心跳') != -1){
                                        sub.name = sub.name.slice(0,sub.name.indexOf('(最近心跳'))
                                    }
                                    if(item.delay>3600){
                                        sub['name'] = sub.name + '(最近心跳:'+ parseInt(item.delay/3600) +'小时前)'
                                    }else if(item.delay>60){
                                        sub['name'] = sub.name + '(最近心跳:'+ parseInt(item.delay/60) +'分钟前)'
                                    }else{
                                        sub['name'] = sub.name + '(最近心跳:'+ parseInt(item.delay) +'秒前)'
                                    }
                                }
                                //遍历到的就是 红色离线
                                sub["itemStyle"] = { color: "rgb(255 0 10)" };
                                sub["lineStyle"] = { color: "rgb(255 0 10)" };
                                sub["label"] = { color: "rgb(255 0 10)", width: 320, overflow: "break" };
                            }
                        })
                        onlineList.forEach(onlineItem => {
                            if (onlineItem.id == sub.value) {
                                if(onlineItem.delay && onlineItem.delay != null){
                                    if(sub.name.indexOf('最近心跳') != -1){
                                        sub.name = sub.name.slice(0,sub.name.indexOf('(最近心跳'))
                                    }
                                    if(onlineItem.delay>3600){
                                        sub['name'] = sub.name + '(最近心跳:'+ parseInt(onlineItem.delay/3600) +'小时前)'
                                    }else if(onlineItem.delay>60){
                                        sub['name'] = sub.name + '(最近心跳:'+ parseInt(onlineItem.delay/60) +'分钟前)'
                                    }else{
                                        sub['name'] = sub.name + '(最近心跳:'+ parseInt(onlineItem.delay) +'秒前)'
                                    }
                                }
                                //遍历到的就是 绿色在线
                                sub["itemStyle"] = { color: "#00FF33" };
                                sub["lineStyle"] = { color: "#00FF33" };
                                sub["label"] = { color: "#00FF33", width: 320, overflow: "break" };
                            }
                        })
                        unclearList.forEach(UItem => {
                            if (UItem.id == sub.value) {
                                //遍历到的就是 未知 灰色
                                // if (sub.itemStyle != undefined) {
                                //     Reflect.deleteProperty(sub,"itemStyle");
                                //     Reflect.deleteProperty(sub,"lineStyle");
                                //     Reflect.deleteProperty(sub,"label")
                                // }
                                sub["itemStyle"] = "";
                                sub["lineStyle"] = "";
                                sub["label"] = "";
                            }
                        })
                        //节点的设备类型
                        switch(sub.type){
                            case 'server':
                                return {
                                    name: sub.name,
                                    value: sub.value,
                                    type: sub.type,
                                    itemStyle: sub.itemStyle,
                                    lineStyle: sub.lineStyle,
                                    label: sub.label,
                                    symbol: "image://data:image/png;base64,"
                                    , symbolSize: 35,
                                    symbolOffset: [0, "-25%"],
                                    symbolKeepAspect: true,
                                    children: sub.children != undefined ? (sub.children.length != 0 ? recursion(sub.children) : sub.children) : []
                                }
                            case 'ModbusGateway':
                                return {
                                    name: sub.name,
                                    value: sub.value,
                                    type: sub.type,
                                    itemStyle: sub.itemStyle,
                                    lineStyle: sub.lineStyle,
                                    label: sub.label,
                                    symbol: "image://data:image/png;base64,"
                                    , symbolSize: 30,
                                    symbolOffset: [0, "-25%"],
                                    symbolKeepAspect: true,
                                    children: sub.children != undefined ? (sub.children.length != 0 ? recursion(sub.children) : sub.children) : []
                                };
                            case 'SiemensPLC':
                                return {
                                    name: sub.name,
                                    value: sub.value,
                                    type: sub.type,
                                    itemStyle: sub.itemStyle,
                                    lineStyle: sub.lineStyle,
                                    label: sub.label,
                                    symbol: "image://data:image/png;base64,"
                                    , symbolSize: 30,
                                    symbolOffset: [0, "-25%"],
                                    symbolKeepAspect: true,
                                    children: sub.children != undefined ? (sub.children.length != 0 ? recursion(sub.children) : sub.children) : []
                                };
                            case 'EnergyMeter':
                                return {
                                    name: sub.name,
                                    value: sub.value,
                                    type: sub.type,
                                    itemStyle: sub.itemStyle,
                                    lineStyle: sub.lineStyle,
                                    label: sub.label,
                                        symbol: "image://data:image/png;base64,"
                                    , symbolSize: 30,
                                    symbolOffset: [0, "-25%"],
                                    symbolKeepAspect: true,
                                    children: sub.children != undefined ? (sub.children.length != 0 ? recursion(sub.children) : sub.children) : []
                                };
                            case 'WaterMeter':
                                return {
                                    name: sub.name,
                                    value: sub.value,
                                    type: sub.type,
                                    itemStyle: sub.itemStyle,
                                    lineStyle: sub.lineStyle,
                                    label: sub.label,
                                    symbol: "image://data:image/png;base64,"
                                    , 
                                    symbolSize: 35,
                                    symbolOffset: [0, "-25%"],
                                    symbolKeepAspect: true,
                                    children: sub.children != undefined ? (sub.children.length != 0 ? recursion(sub.children) : sub.children) : []
                                };
                            case 'PowerMeter':
                                return {
                                    name: sub.name,
                                    value: sub.value,
                                    type: sub.type,
                                    itemStyle: sub.itemStyle,
                                    lineStyle: sub.lineStyle,
                                    label: sub.label,
                                        symbol: "image://data:image/png;base64,"
                                    , 
                                    symbolSize: 35,
                                    symbolOffset: [0, "-25%"],
                                    symbolKeepAspect: true,
                                    children: sub.children != undefined ? (sub.children.length != 0 ? recursion(sub.children) : sub.children) : []
                                };
                            default:
                                return {
                                    name: sub.name,
                                    value: sub.value,
                                    type: sub.type,
                                    itemStyle: sub.itemStyle,
                                    lineStyle: sub.lineStyle,
                                    label: sub.label,
                                    children: sub.children != undefined ? (sub.children.length != 0 ? recursion(sub.children) : sub.children) : []
                                };
                        }
                    })
                    return data
                }

                newMap[0].children = recursion(newMap[0].children)
            }

            if (previousData !== JSON.stringify(newMap)) {
                this.getChartOption(newMap,width);
                this.setState({
                    paneData: newMap
                })
                
            }
        }

    }

    //画图
    getChartOption(data,width) {

        let option = {
            tooltip: {
                trigger: 'item',
                triggerOn: 'mousemove'
            },
            series: [
                {
                    type: 'tree',
                    data: data,
                    // roam:true,
                    symbolSize: 14,
                    width:width,
                    left: "0.2%",
                    orient: 'TB',
                    label: {
                        position: 'bottom',
                        fontSize: 14,
                    },
                    leaves: {
                        label: {
                            position: 'bottom'
                        }
                    }
                }
            ]
        }
        this.setState({
            option: option
        })
    }

    //==================================================================================================================================
    treeNodeclick = (param) => {
        /* true 代表点击的是圆点
           fasle 表示点击的是当前节点的文本
        */
        if(param.event.target.culling === true){
            this.setState({
                visible: true,
                id:param.data.value,
                name:param.data.name
            })
        } else if(param.event.target.culling === false){
            return
        }
    }

    closeHistoryModal = () => {
        this.setState({
            visible:false
        })
    }

    saveChartRef = (chart) => {
        if (chart) {
          this.chart = chart.getEchartsInstance();
          this.chart.on('click',this.treeNodeclick)
          console.info( this.chart )
        } else {
          this.chart = chart;
        }
    }

    //===================================================================================================================================

    onChange = (key) => {
        if (this.state.data.length != 0) {
            this.setState({
                activeKey: key,
                tabsLoading: true
            })
            setTimeout(()=>{
                this.setState({
                    tabsLoading: false
                })},4000);
            this.getData(this.state.data[key])
        }
    }

    render() {
        const { visible, onCancel } = this.props
        return (
            <div>
                {
                    visible ?
                        <Modal
                            visible={visible}
                            onCancel={onCancel}
                            footer={null}
                            width={1200}
                            maskClosable={false}
                            title='网络拓扑'
                        >
                            <div >
                                {
                                    this.state.tabsLoading ?
                                        <div style={{ width: 1150, height: 650, textAlign: 'center', marginTop: '30px' }}>
                                            <Spin tip="正在读取数据" />
                                        </div>
                                        :
                                        <Tabs
                                            onChange={this.onChange}
                                            activeKey={this.state.activeKey}
                                        >
                                            {this.state.panes.length != 0 ?
                                                this.state.panes.map(pane => <TabPane tab={pane.networkName} key={pane.key}  >
                                                    <div style={{ width: 1150, height: 650, overflow: "scroll" }}>
                                                        <ReactEcharts
                                                            style={{
                                                                width: echartsWidth+50,
                                                                height: 650
                                                            }}
                                                            ref = {this.saveChartRef}
                                                            option={this.state.option}
                                                            theme="dark"
                                                            notMerge={true}
                                                        />
                                                    </div>

                                                </TabPane>)
                                                :
                                                ""
                                            }
                                        </Tabs>
                                }

                            </div>
                        </Modal>
                        :
                        ""
                }
                <HistoryOnlineStatus
                    visible = {this.state.visible}
                    handleCancel = {this.closeHistoryModal}
                    id = {this.state.id}
                    name = {this.state.name}
                />
            </div>

        )
    }
}

export default NetworkManageModalView